            <div>
                <h2 style = {{fontWeight:"100", marginTop:"10px", marginLeft:"5%", fontFamily: "'cenzil', serif", fontSize:"1.2em"}}>We are <span style = {{backgroundColor:"rgb(235 40 47)", fontFamily: "system-ui",color:"white", borderRadius:"5px"}}>  Authorized Dealers of Al-Noor and West Marina</span> which are projects of Al-Jalil Garedns </h2>
            </div>
            <div>
                <img src = {realestate} style = {{width:"40%",height:"400px"}}></img>
            </div>
            </div>
        </>
    )

}

